import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Test from './Test';
import {BrowserRouter} from "react-router-dom";

ReactDOM.render(
  <>
  <Test/>
  {<BrowserRouter>
    <App />
  </BrowserRouter>}
  </>,
  document.getElementById('root')
);
